import React, { Component } from 'react'
import { NavLink } from "react-router-dom";

export default class Navbar extends Component {
    render() {
        return (
            <div>
                <nav>
                    <ul className="mr-auto">
                        <li>
                            <NavLink to="/">Product</NavLink>
                        </li>
                        <li>
                            <NavLink to="/cart">Cart</NavLink>
                        </li>
                </ul>
                </nav> 
            </div>
        )
    }
}
